import './Test.css'
export default function Testik() {
  return (
    <div className="chat-wrapper">
      <div className="message bot-message">
        Привет! Чем могу помочь?
      </div>

      <div className="message user-message">
        Хочу узнать курс валют
      </div>
    </div>
  );
}
